import { useState } from "react";
import ReactMapGL, { Marker } from "react-map-gl";

function App() {
  const [viewport, setViewport] = useState({
    width: "100vw", //1990
    height: "100vh", // 800
    latitude: 40.73061,
    longitude: -73.935242,
    zoom: 10,
  });
  return (
    <div className="App">
      {" "}
      <ReactMapGL
        {...viewport}
        mapboxApiAccessToken={process.env.REACT_APP_MAPBOX}
        onViewportChange={(nextViewport) => setViewport(nextViewport)}
      >
        <Marker
          latitude={37.78}
          longitude={-122.41}
          offsetLeft={-20}
          offseetTop={-10}
        >
          <div>You are here</div>
        </Marker>
      </ReactMapGL>
    </div>
  );
}

export default App;
